//Core imports
import React, {Component} from 'react';
import PropTypes from 'prop-types';
import {withTracker} from "meteor/react-meteor-data";
import {Meteor} from "meteor/meteor";

//Component imports
import {Supplier} from "../../../../api/PurchasingAPI/supplier";

//Semantic-UI
import {Popup, Button} from "semantic-ui-react";

//Other
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";
import moment from "moment";

//Component
class PrintPO extends Component {
    state = {};

    printPO = () => {
        if(this.props.ready) {
            let sName = this.props.supplierObj.officialName;
            let sAddress = this.props.supplierObj.streetAddress;
            let sCity = this.props.supplierObj.city;
            let sProvince = this.props.supplierObj.province;
            let sCountry = this.props.supplierObj.country;
            let sPostalCode = this.props.supplierObj.postalCode;
            let sPhoneNumber = this.props.supplierObj.phoneNumber;
            let sEmail = this.props.supplierObj.email;

            let docDefinition = {
                footer: [{text: 'Intelline Inc. - Purchase Order', alignment: 'center'}],
                content: [
                    {
                        alignment: 'right',
                        width: 150,
                        image: 'data:image/png;base64,'
                    },
                    {text: 'PO #: ' + this.props.poNum + '\n', bold: true},
                    {text: ' '},
                    {text: 'Vendor:\n', bold: true},
                    {text: sName + '\n' + sAddress + '\n' + sCity + ', ' + sProvince + '\n' + sCountry + ' ' + sPostalCode},
                    {text: 'Phone #: ' + sPhoneNumber},
                    {text: 'Email: ' + sEmail},
                    {text: ' '},
                    {text: 'Bill to:', bold: true},
                    {text: 'Intelline Inc.\n151 Charles Street West,\nUnit 199\nKitchener, ON\nCanada N2G 1H6\nPhone #: 905-550-4549\nEmail: kylefaller@intelline.ca'},
                    {text: ' '},
                    {text: [{text: 'Order Date: ', bold: true}, moment().format('dddd, MMMM Do YYYY')]},
                    {text: ' '},
                    {
                        table: {
                            widths: ['auto', '*', 'auto', 'auto', 'auto'],
                            body: [
                                [{text: 'ID #', bold: true}, {text: 'Description', bold: true}, {text: 'Quantity', bold: true}, {text: 'Unit Price', bold: true}, {text: 'Amount', bold: true}],
                                ...this.props.expTransformed,
                                [{text: 'TOTAL', bold: true}, '', '', '', {
                                    text: '$' + this.props.orderTotal.toFixed(2),
                                    bold: true,
                                    alignment: 'right'
                                }]
                            ]
                        }
                    },
                ]
            };
            pdfMake.createPdf(docDefinition).download();
        }
    };

    render() {
        return (
            <Popup
                trigger={<Button circular icon='print' color={'teal'} onClick={this.printPO}/>}
                content='Print PO'
                position='bottom center'
                inverted
            />
        )
    }
}

//Type-checking
PrintPO.propTypes = {
    poNum: PropTypes.string,
    supplier: PropTypes.string,
    dateOrdered: PropTypes.instanceOf(Date),
    orderCurrency: PropTypes.string,
    expenditures: PropTypes.array,
    orderTotal: PropTypes.number,

    ready: PropTypes.bool,
    supplierObj: PropTypes.object,
    expTransformed: PropTypes.array
};

const PrintPOContainer = withTracker(props => {
    let nickname = props.supplier;
    let supplierHandle = Meteor.subscribe('supplierDetails', nickname);

    let ready = supplierHandle.ready();
    let supplierObj;
    let expTransformed = [];

    if(ready) {
        supplierObj = Supplier.findOne();
        expTransformed = props.expenditures.map(exp => [
            exp.extNum,
            exp.extDesc,
            exp.quantOrd,
            {
                text: '$' + (+exp.unitPrice).toFixed(2),
                alignment: 'right'
            },
            {
                text: '$' + (+(exp.quantOrd*exp.unitPrice)).toFixed(2),
                alignment: 'right'
            },
        ]);
    }

    return {
        ready,
        supplierObj,
        expTransformed
    };
})(PrintPO);

export default PrintPOContainer;